import React from "react";
import styles from "../modules/AboutUs.module.css";

export default function AboutUs() {
  return (
    <div className={styles.container}>
      <p className={styles.text}>
        Handshake is a decentralized, permissionless naming protocol. Handshake
        names are top-level domains (TLDs). We are selling Handshake TLDs and
        SLDs which will power the new internet resolution of decentralisaton
      </p>
    </div>
  );
}
